import './App.css';
import AIToolList from './components/AIToolList';
import AIToolDetails from './components/AIToolDetails';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <div className="App" style={{ position: 'relative', overflow: 'hidden', height: '100vh' }}>
        <iframe
          src='https://my.spline.design/robotfollowcursorforlandingpage-9f106b3356a92dcc74818c539de79db7/'
          frameBorder='0'
          width='100%'
          height='100%'
          style={{
            position: 'fixed',
            top: 0,
            left: 0,
            width: '100%',
            height: '100%',
            zIndex: -1,
          }}
        />
        <nav className="navbar">
          <h1>AI Tools App</h1>
          <div>
            <a href="/">Home</a>
            <a href="/categories">Categories</a>
          </div>
        </nav>
        <header className="App-header">
          <div className="hero">
          </div>
          <Routes>
            <Route path="/" element={<AIToolList />} />
            <Route path="/tool/:id" element={<AIToolDetails />} />
          </Routes>
        </header>
      </div>
    </BrowserRouter>
  );
}

export default App;
